INSERT INTO `answers_master` (`id`, `user_id`, `question_id`, `sub_sub_cat_id`, `answer`, `image`, `level`, `upvote`, `downvote`, `post_date`, `post_time`) VALUES
(53, 'Admin', 16, '361', '<p>CPU Virtualization is a process of transforming the capability of CPUs into more detailed and refined layers for more efficient and effective usage. This is built-in, and there are steps needed to be enabled so that it can be performed.</p>\r\n\r\n<p>Virtual machines require this process to be activated, and the only way is through the BIOS configuration. Before we dive into the procedures, you need to check first if your motherboard is capable of virtualization through the following steps.</p>\r\n\r\n<p><strong><em>Checking of Virtualization Capability</em></strong></p>\r\n\r\n<p>These steps will save your time whether virtualization is enabled or disabled or not possible at all.</p>\r\n\r\n<ol>\r\n	<li>Open the <span dir=\"RTL\">&lsquo;</span>Task Manager<span dir=\"RTL\">&rsquo; </span>either through the shortcut keys or the taskbar.&nbsp;</li>\r\n	<li>A window will open. Select the <span dir=\"RTL\">&lsquo;</span>Performance<span dir=\"RTL\">&rsquo; </span>tab.</li>\r\n	<li>Search at the bottom-right for <span dir=\"RTL\">&lsquo;</span>Virtualization.<span dir=\"RTL\">&rsquo; </span>See if it is enabled or disabled.If disabled, you will proceed to the next step, which is to check if your PC setup supports virtualization.&nbsp;</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Description: https://support.bluestacks.com/hc/article_attachments/360045578871/Task_Manager.png\" src=\"data:image/png;base64,\" style=\"float:left; height:353px; width:467px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;https://images.app.goo.gl/NVvA95VfEBVLjR8o9</p>\r\n\r\n<ol>\r\n	<li>If disabled, you will proceed to the next step, which is to check if your PC setup supports virtualization.</li>\r\n</ol>\r\n\r\n<p><strong><em>Checking of PC Requirements</em></strong></p>\r\n\r\n<p>We will be tackling both Intel and AMD. Both can have different ways of checking if the PC met the requirements.</p>\r\n\r\n<p><strong>For Intel&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>Download the appropriate virtualization detection tool.</li>\r\n	<li>Run the file and choose your language.</li>\r\n	<li>After installation, open the program. Select for <span dir=\"RTL\">&lsquo;</span>CPU Technologies.<span dir=\"RTL\">&rsquo;</span></li>\r\n</ol>\r\n\r\n<p><img alt=\"Description: https://support.bluestacks.com/hc/article_attachments/360045579011/INTEL_2.png\" src=\"data:image/png;base64,\" style=\"float:left; height:314px; width:523px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"https://images.app.goo.gl/xumf5u7z3jQbsvaM7\">https://images.app.goo.gl/xumf5u7z3jQbsvaM7</a></p>\r\n\r\n<ol>\r\n	<li>A menu will drop down, and all the information related to the virtualization will be shown. If there is a &lsquo;tick&rsquo; on the &lsquo;Intel Virtualization Technology,&rsquo; virtualization is possible on your PC Setup.</li>\r\n</ol>\r\n\r\n<p><strong>For AMD</strong></p>\r\n\r\n<ol>\r\n	<li>Download the appropriate virtualization detection tool.</li>\r\n	<li>Run the file as administrator and have it installed.</li>\r\n	<li>After installation, it will automatically show if virtualization is possible or not. It will also display the current state of the PC<span dir=\"RTL\">&rsquo;</span>s virtualization, similar to the procedure for <span dir=\"RTL\">&lsquo;</span>Checking of Virtualization Capability.<span dir=\"RTL\">&rsquo;</span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</em></strong><strong><em><img alt=\"Description: https://support.bluestacks.com/hc/article_attachments/360045579071/AMD_V_TOOL.png\" src=\"data:image/png;base64,\" style=\"height:174px; width:507px\" /></em></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><em>How to Enable Virtualization</em></strong></p>\r\n\r\n<p>You can enable it by having visited the BIOS settings. There are different ways of accessing BIOS. The easiest way is to refer to the manual of your PC or laptop. Once you have entered the BIOS settings, then you are good to go.</p>\r\n\r\n<p><strong>For Intel&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>You need to enter <span dir=\"RTL\">&lsquo;</span>Advanced Mode<span dir=\"RTL\">&rsquo; </span>or press the F7 on your keyboard.</li>\r\n	<li>Under the Advanced Mode, go to the <span dir=\"RTL\">&lsquo;</span>Advanced<span dir=\"RTL\">&rsquo; </span>tab.</li>\r\n	<li>Under the <span dir=\"RTL\">&lsquo;</span>Advanced<span dir=\"RTL\">&rsquo; </span>tab, there are various options presented. Select the <span dir=\"RTL\">&lsquo;</span>CPU Configuration.<span dir=\"RTL\">&rsquo;</span></li>\r\n	<li>Under the CPU Configuration, locate the <span dir=\"RTL\">&lsquo;</span>Intel Virtualization Technology.<span dir=\"RTL\">&rsquo; </span>If <span dir=\"RTL\">&lsquo;</span>Disabled,<span dir=\"RTL\">&rsquo; </span>you can enable it by clicking its status to change into <span dir=\"RTL\">&lsquo;</span>Enabled.<span dir=\"RTL\">&rsquo;</span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"Description: Intel_-_5.dib\" src=\"data:image/png;base64,\" style=\"height:376px; width:474px\" /></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href=\"https://images.app.goo.gl/GZGdWS4tfKdJiVz66\">https://images.app.goo.gl/GZGdWS4tfKdJiVz66</a></p>\r\n\r\n<ol>\r\n	<li>If it is enable, you can now exit BIOS settings. Make sure it to click on &lsquo;Save changes and exit&rsquo;. Then allow your computer to restart, and you&rsquo;re ready for virtualization.</li>\r\n</ol>\r\n\r\n<p><strong>For AMD</strong><strong>&nbsp;</strong></p>\r\n\r\n<ol>\r\n	<li>You need to enter <span dir=\"RTL\">&lsquo;</span>Advanced Mode<span dir=\"RTL\">&rsquo; </span>or press the F7 on your keyboard.</li>\r\n	<li>Under the Advanced Mode, go to the <span dir=\"RTL\">&lsquo;</span>Advanced<span dir=\"RTL\">&rsquo; </span>tab.</li>\r\n	<li>Under the <span dir=\"RTL\">&lsquo;</span>Advanced<span dir=\"RTL\">&rsquo; </span>tab, there are various options presented. Select the <span dir=\"RTL\">&lsquo;</span>CPU Configuration.<span dir=\"RTL\">&rsquo;</span></li>\r\n	<li>Under the CPU Configuration, locate the <span dir=\"RTL\">&lsquo;</span>SVM Mode. If <span dir=\"RTL\">&lsquo;</span>Disabled,<span dir=\"RTL\">&rsquo; </span>you can enable it by clicking its status to change into <span dir=\"RTL\">&lsquo;</span>Enabled.<span dir=\"RTL\">&rsquo;</span></li>\r\n</ol>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"Description: AMD_-_4.dib\" src=\"data:image/png;base64,\" style=\"height:359px; width:479px\" /></p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a href=\"https://images.app.goo.gl/inxKWtLbBRyHpXF59\">https://images.app.goo.gl/inxKWtLbBRyHpXF59</a></p>\r\n\r\n<ol>\r\n	<li>Once it is enable, click on the &lsquo;Save changes and exit&rsquo; then restart your computer.</li>\r\n</ol>\r\n\r\n<p>Generally, the two chipsets have the same procedures except on the label for the virtualization feature.</p>\r\n\r\n<p><strong><em>Conclusion</em></strong></p>\r\n\r\n<p>Virtualization technically poses no relevant risks in computer performance, if caution is exercised. It is just a feature so that you can run virtual machines. Virtual machines technically have two programs that are supposed to run on different computers but are being performed on one desktop.&nbsp;</p>\r\n\r\n<p>One example of which is running another operating system under a currently working operating system. The steps are straightforward, and you don<span dir=\"RTL\">&rsquo;</span>t need to be that techy to figure things out.</p>\r\n', '', 'Open', '', '1', '2020-07-03', '10:15');
INSERT INTO `answers_master` (`id`, `user_id`, `question_id`, `sub_sub_cat_id`, `answer`, `image`, `level`, `upvote`, `downvote`, `post_date`, `post_time`) VALUES
(73, '12', 15, '119', '<p><strong>Introduction</strong></p>\r\n\r\n<p>Wallpapers are a big part of personalizing and adding your custom touch to your computer. While Windows 10 still offers a plethora of customization options, animated wallpapers are not a built-in option anymore. It used to be much easier on older Windows versions, but now you need to download third-party software in order to use live wallpapers.</p>\r\n\r\n<p>Thankfully, it&rsquo;s not a difficult task. In this article, I will show you different ways to run animated wallpapers on your Windows 10 computer.</p>\r\n\r\n<p><strong>Before You Get Started</strong></p>\r\n\r\n<p>It&rsquo;s important to note that not all computers are built to handle animated wallpapers. They can take a significant amount of CPU and GPU resources from your computer. That means, it&rsquo;s not ideal for older and less powerful computers because there is a chance of choking the system, which reduces its overall performance, lifespan, and even battery life if you&rsquo;re running it on a laptop.</p>\r\n\r\n<p>So before installing animated wallpapers onto your system, make sure first that your computer has enough CPU and GPU power to handle it.</p>\r\n\r\n<p><strong>What You Need</strong></p>\r\n\r\n<p>Windows 10 does not have a built-in feature for applying animated wallpapers, and you need to install third-party software for it. Here are the options we&rsquo;re going to look at today:</p>\r\n\r\n<ul>\r\n	<li>Stardock DeskScapes</li>\r\n	<li>PUSH Video Wallpaper</li>\r\n</ul>\r\n\r\n<p>Let&rsquo;s talk about how to use each of them.</p>\r\n\r\n<p><strong>Stardock DeskScapes</strong></p>\r\n\r\n<p>Stardock DeskScapes is a $7 animated wallpaper software, but there&rsquo;s a 30-day free trial available on their website for you to try out first.</p>\r\n\r\n<p>Download the free trial (or buy it) on the Stardock website. Run the downloaded executable file, and then install it.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:352px; width:450px\\\" /></p>\r\n\r\n<p>Once open, it will ask for a product key. Select the option that suits you. For this article, we&rsquo;ll work with a 30-day trial. Click on &ldquo;Start 30 Day Trial&rdquo; and enter your email address. Stardock will send you an email for activating your 30-day trial. Simply click &ldquo;Activate 30-Day Trial&rdquo; to start using Deskscapes.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:378px; width:624px\\\" /></p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:133px; width:624px\\\" /></p>\r\n\r\n<p>Once you&rsquo;re in, all you need to do now is to select the background you want, and click &ldquo;Apply to my desktop&rdquo;.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:382px; width:624px\\\" /></p>\r\n\r\n<p>There are 9 wallpapers already available to you in the app, but DeskScapes can also read videos to use as animated wallpapers. Additionally, you can also get more animated wallpapers online within the app or using a different website.</p>\r\n\r\n<p>With DeskScapes, you can edit the effects of the images and videos, and some animated wallpapers also have configurable properties that are specific to that wallpaper, like the speed of the Earth&rsquo;s rotation, for example. Video volume and speed are also customizable.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:509px; width:624px\\\" /></p>\r\n\r\n<p><strong>PUSH Video Wallpaper</strong></p>\r\n\r\n<p>One of the simplest applications that one can use is the PUSH Video Wallpaper. It can play gifs and videos, even the ones off of YouTube. This application also comes with a free trial, but it can costs around $11 for a full license.</p>\r\n\r\n<p>To start, download PUSH Video Wallpaper from their website and install it.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong><img src=\\\"data:image/png;base64,\\\" style=\\\"height:301px; width:499px\\\" /></strong></p>\r\n\r\n<p>Once installed and opened, the software will show a demo playlist with a few sample wallpapers. Look around and check out the application. It will play each item on the list, and it will also play a video&rsquo;s sound.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:471px; width:506px\\\" /></p>\r\n\r\n<p>They also give you the option to adjust the brightness of your wallpaper and the transparency of your desktop icons. With PUSH Video Wallpaper, you can also run any video of your choice, and it will play the whole clip.</p>\r\n\r\n<p><img src=\\\"data:image/png;base64,\\\" style=\\\"height:443px; width:521px\\\" /></p>\r\n\r\n<p><strong>Other Software Options</strong></p>\r\n\r\n<p>While the two above are trustworthy applications, you are not limited to using only them. The following are a few more paid and free applications that also allow you to use animated wallpapers on your computer:</p>\r\n\r\n<ul>\r\n	<li>Wallpaper Engine (around $5)</li>\r\n	<li>DesktopHut (free)</li>\r\n	<li>Dynamic Wallpaper Apps from the Microsoft Store (price varies)</li>\r\n</ul>\r\n\r\n<p><strong>Conclusion</strong></p>\r\n\r\n<p>Stardock Deskscapes and PUSH Video Wallpaper are applications that help you use animated wallpapers for your computer, but they are only two out of the many software available online. Still, we hope this article has made it easier for you to get started with using animated wallpapers on your Windows 10 computer. That the information given above will surely lead you to the right direction, and closer to your ideal computer look.</p>\r\n', NULL, 'Approved', '', '', '2020-09-11', '19:27:29');
INSERT INTO `answers_master` (`id`, `user_id`, `question_id`, `sub_sub_cat_id`, `answer`, `image`, `level`, `upvote`, `downvote`, `post_date`, `post_time`) VALUES
