INSERT INTO `cms_master` (`id`, `page_name`, `content`) VALUES
(1, 'How it works', '<p>Fixer Geek is NOT yet another answers website. It is a patent pending concept allowing you to ask question, get replies and even get the problem fixed remotely by someone who\\\'s expert in the category you\\\'re having problem in right away.</p><p>You can choose to let a Fixer work on your device using Remote Desktop Assistant, Screen Sharing & Voice Chat or Text Chat. It\\\'s like having a big brother online when you\\\'re having any issues with your PC, Mac, iOS or Android. Furthermore, all Fixers are rated and ranked by other Geeks.</p><p>Not to mention, the usual answers provided to you or related answers on <a href=\\\"https://rbajsol.com/projects/fixergeek/\\\">FixerGeek.com </a>might just be sufficient. You can even notify other Geeks to answer your question for Free! Fixer Geek caters all your troubleshooting needs in one umbrella!</p><p>Apart from all the benefits and perks you receive as a Asker Geek, you may want to become a Fixer Geek yourself. Make money online doing your favorite job.<a href=\\\"#\\\"> Click here </a>to find out how to become a Fixer Geek and help Geeks having troubleshooting problems.</p><h3>Here\\\'s how it works in a nutshell;</h3>'),
(2, 'Terms and use', '<p><strong>Terms of Use</strong></p>\r\n\r\n<p><strong>Introduction:</strong></p>\r\n\r\n<p>Below is a summary of our terms of use in a nutshell:</p>\r\n\r\n<ul>\r\n <li><strong>Your \\\"Big Brother Online\\\"</strong></li>\r\n</ul>\r\n\r\n<p>Our mission is to become your \\\"Big Brother Online\\\" for your troubleshooting problems! We cater you with all possible tools to resolve your troubleshooting problems with your PC, Mac, iOS, Android, Apps and Web Services. Going as far as getting your problems sorted out by Fixers remotely!</p>\r\n\r\n<ul>\r\n <li><strong>Only Troubleshooting Questions please!</strong></li>\r\n</ul>\r\n\r\n<p>Unlike score of answer sites interested in &#39;How to loose weight without any supplements?&#39; and &#39;What&#39;s the net worth of Jeff Bezos?&#39; we focus our attention solely on day to day technology problems and we like you to focus on these as well. Ask only troubleshooting questions you have regarding your PC, Mac, iPhone, iPad, Android Phones and Tablets, Apps and Web Services to help us grow!</p>\r\n\r\n<ul>\r\n <li><strong>Your Content - Your Responsibility</strong></li>\r\n</ul>\r\n\r\n<p>We remove copyright, trademark and patent infringements without notice. We will not take time to remove your questions and answers if they are regarding use of torrents, cracks, patches, hacks, dissembling, distributing virus, malware, spyware, ransomware, trojan, worm, stolen media, images, videos, music and information or methods that are illegal according to US Laws. With such activity you even risk removal of your account with us.</p>\r\n\r\n<ul>\r\n <li><strong>Strictly No Plagiarism</strong></li>\r\n</ul>\r\n\r\n<p>Be sure that you have rights needed to post your content and that content doesn&#39;t violate the rights of anyone. We also take down any duplicate content you just copied over from another website and pasted here. With such activity you even risk removal of your account with us. Beware!</p>\r\n\r\n<ul>\r\n <li><strong>Be Nice - Be Helpful</strong></li>\r\n</ul>\r\n\r\n<p>We do not tolerate harsh language, hate speech, harassment, bullying, scamming, spamming, defrauding, impersonation or misrepresentation of any kind on<a href=\\\"https://rbajsol.com/projects/fixergeek/\\\">FixerGeek.com</a>If we are reported such an activity by a Geek (a user on our website or app), we make no delays in taking down the account in question and its content after investigation. Other reasons from removing content from our site can be less severe, like not a good use of language or answers that do not solve the issue. This is not a debate platform nor it can be used to cause inconvenience to users. Be civil, be polite and be helpful with your knowledge.</p>\r\n\r\n<ul>\r\n <li><strong>We do not endorse or verify content posted</strong></li>\r\n</ul>\r\n\r\n<p>Operating a troubleshooting website on this level is not an easy task. We cannot verify whether the methods posted our website for a fix of a problem is working, correct or applicable. But as soon as we are reported an issue with it, we do all we can to investigate the content and either remove it or replace it. Furthermore, we do not endorse everything on our website as it is mostly community based effort of users like you.</p>\r\n\r\n<ul>\r\n <li><strong>Dispute Resolution Procedures</strong></li>\r\n</ul>\r\n\r\n<p>In an unlikely event where you paid for a service but didn&#39;t receive support or you gave support to a user and he didn&#39;t pay you, you should first try to resolve the issue amicably among yourself and the other party, however, you can contact us to resolve this issue when all else fails. We take Resolution matters very seriously and may have to dig deep to sort out the issue. In all those cases, we reserve the right to resolve the issue and give a final verdict as to what needs to be done to resolve it. In case you don&#39;t comply to our resolution procedures, you risk getting your account removed with us.</p>\r\n\r\n<ul>\r\n <li><strong>Reporting Complaints</strong></li>\r\n</ul>\r\n\r\n<p>If you have a complaint regarding a user or content posted on our website, you can report it and we&#39;ll investigate the matter. If you have infringement related issues, you must contact us first before contacting any third-party involved with<a href=\\\"https://rbajsol.com/projects/fixergeek/\\\">FixerGeek.com</a></p>\r\n\r\n<ul>\r\n <li><strong>Rights of Administrators</strong></li>\r\n</ul>\r\n\r\n<p>We, being the owner of<a href=\\\"https://rbajsol.com/projects/fixergeek/\\\">FixerGeek.com</a>reserve the right to delete any content on our website for whatever reason. Furthermore, we can remove any user&#39;s account who doesn&#39;t respect our Terms of Use in any way, shape or form.</p>\r\n\r\n<p>We are pleased that you want to join the Quora platform and encourage you to read the full Terms of Service.</p>\r\n\r\n<p></p>\r\n'),
(3, 'Privacy policy', '<p>Windows 10 has a feature that allows the user to write using a pen as it converts to typed text. You may also be using a PC or laptop that has a touch screen. However, you may experience trouble when using the pen on your computer. This article provides a comprehensive guide on how to fix a touch screen or pen to work on your Windows 10.</p>\r\n\r\n<p><strong>How to fix touch screen problems on Windows 10</strong></p>\r\n\r\n<p>Fixing touch screen problems on Windows 10 can be done in 4 simple ways:</p>\r\n\r\n<p><strong>1. Disable and then re-enable the HID (human interface device) driver on your touch screen</strong></p>\r\n'),
(4, 'About us', '<p>Windows 10 has a feature that allows the user to write using a pen as it converts to typed text. You may also be using a PC or laptop that has a touch screen. However, you may experience trouble when using the pen on your computer. This article provides a comprehensive guide on how to fix a touch screen or pen to work on your Windows 10.</p>\r\n\r\n<p><strong>How to fix touch screen problems on Windows 10</strong></p>\r\n\r\n<p>Fixing touch screen problems on Windows 10 can be done in 4 simple ways:</p>\r\n\r\n<p><strong>1. Disable and then re-enable the HID (human interface device) driver on your touch screen</strong></p>\r\n');
